sourcesContent:
import styled from "styled-components";

export const IconStyle = styled.div`

svg {
    background: #00FF7F;
    color: #ffff;
    float: left;
    margin-top: 50px;
    margin-left: 50px;
    width: 60px;
    height: 30px;
    position: absolute;
    border-radius: 20px;
    border: solid 5px black;
}

`
